  <div class="post-content e-content" itemprop="articleBody">
    <p>Outcast unclean this stone <br />
our breath across but in poised <br />
digit that water’s countenance: <br /></p>

<p>O, if the waves would <br />
and the sea constrain our greying <br />
scarlet: we will this life <br />
have ever lived. <br /></p>
